          - locationName: TGT
            nodeName: L_MAPPINGS_COMMUNITY_CONTACT_FACE_TO_FACE
          - locationName: TGT
            nodeName: DIM_USER_LOGIN_CONCERTO
        join:
          joinCondition: |-
            FROM s_contact_community_09
              LEFT OUTER JOIN l_Reference_CDSSWE_Contact_PU
                ON s_contact_community_09.task_request_id = l_Reference_CDSSWE_Contact_PU.task_request_id
              LEFT OUTER JOIN s_mappings_PurchaseUnit_CDS_Contacts
                ON s_mappings_PurchaseUnit_CDS_Contacts.Contact_Type = s_contact_community_09.contact_type_desc
               AND s_mappings_PurchaseUnit_CDS_Contacts.Department = s_contact_community_09.department_desc
               AND s_mappings_PurchaseUnit_CDS_Contacts.Occupational_group = s_contact_community_09.role_code
               AND s_mappings_PurchaseUnit_CDS_Contacts.Location = s_contact_community_09.location_desc
               AND s_mappings_PurchaseUnit_CDS_Contacts.professional_carer_reference_no = s_contact_community_09.seen_by_clinician_reference_no
               AND IFNULL(s_mappings_PurchaseUnit_CDS_Contacts.contact_purpose_code,'x') = IFNULL(s_contact_community_09.contact_purpose_code,'x')
               AND s_contact_community_09.observation_report_completion_date BETWEEN s_mappings_PurchaseUnit_CDS_Contacts.Start_date AND IFNULL(s_mappings_PurchaseUnit_CDS_Contacts.End_date,getdate())
              LEFT OUTER JOIN {{ ref('TGT','L_MAPPINGS_ADCAT_PURCHASER') }}
                ON s_contact_community_09.referral_admin_category_reference_no = l_mappings_AdCat_Purchaser.RFVAL_REFNO
               AND l_mappings_AdCat_Purchaser.End_date IS NULL
              LEFT OUTER JOIN {{ ref('TGT','L_MAPPINGS_COMMUNITY_CONTACT_FACE_TO_FACE') }}
                ON s_contact_community_09.contact_type_desc = l_mappings_community_contact_face_to_face.contact_type_desc
               AND l_mappings_community_contact_face_to_face.end_date IS NULL
              LEFT OUTER JOIN {{ ref('TGT','DIM_USER_LOGIN_CONCERTO') }}
                ON s_contact_community_09 .create_user_login_name = dim_user_login_concerto.user_name
               AND IFNULL(dim_user_login_concerto.validity_start_date, GETDATE()-10000) <= s_contact_community_09.task_request_date
               AND IFNULL(dim_user_login_concerto.validity_end_date, GETDATE()+10000) >= s_contact_community_09.task_request_date
